Description: Have you ever wondered how electronic gadgets are created? Do you have an idea for a new proof-of-concept tech device or electronic toy but have no way of testing the feasibility of the device? Have you accumulated a junk box of electronic parts and are now wondering what to build? Learn Electronics with Arduino will answer these questions to discovering cool and innovative applications for new tech products using modification, reuse, and experimentation techniques. You'll learn electronics concepts while building cool and practical devices and gadgets based on the Arduino, an inexpensive and easy-to-program microcontroller board that is changing the way people think about home-brew tech innovation.

Title: Learn Electronics with Arduino
Author: Don Wilcher
Publisher: Apress
Year: 2012
ISBN: 978-1430242666
Format: PDF

